import { EditorWindow } from "./EditorWindow"
import { Files } from "./files/Files"
import { Hierarchy } from "./hierarchy/Hierarchy"
import { Inspector } from "./inspector/Inspector"
import { UI } from "./UI"

export const Editor = () => {
  const { width, height } = window.data.editor

  const width0 = 320
  const width2 = width - width0

  return <>
    <UI />
    <div
      style={{
        width: width,
        height: height,
        display: "grid",
        gridTemplateColumns: `${width0}px auto`,
        gridTemplateRows: "55vh auto",
        gap: 1,
        backgroundColor: "#aaa"
      }}
    >
      <EditorWindow
        text="Hierarchy"
        position={{
          x: 1,
          y: 1
        }}
        style={{
          width: width0
        }}
        content={<Hierarchy />}
      />
      <EditorWindow
        text="Inspector"
        position={{
          b: 2,
          x: 2,
          y: 1
        }}
        style={{
          width: width1,
          height: height
        }}
        content={<Inspector />}
      />
      <EditorWindow
        text="Files"
        position={{
          x: 1,
          y: 2
        }}
        style={{
          width: width0
        }}
        content={<Files />}
      />
    </div>
  </>
}
